    return (
      <div className="fiftyPix">
        <p>Third-year CS student at Lancaster University.</p>
        <h4>Skills:</h4>
        <p>Java, JavaScript, React.js, Teamworking</p>
        <h4>Hobbies:</h4>
        <p>Volleyball, Gym, Video production, </p>
      </div>
    );
  }

  export default AboutMe;
